chte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Pcc='Dienstag',zyc='Dimension',vkc='Dimension [height=',Puc='DirectionalTextHelper',ddc='Do',Ycc='Do.',Suc='DockLayoutPanel',Tuc='DockLayoutPanel$Direction',Uuc='DockLayoutPanel$Direction;',Xuc='DockLayoutPanel$DockAnimateCommand',Vuc='DockLayoutPanel$LayoutData',_qc='DomEvent',erc='DomEvent$Type',Rcc='Donnerstag',hxc='Double',xhc='EAST',$9b='EEE, d MMM yyyy HH:mm:ss Z',onc='EEE. dd MMM. yyyy HH:mm:ss',sac='EEEE d. MMMM',bac='EEEE, d. MMMM y',A8b='EM',efc='EMPTY',jfc='ENABLED',qdc='END',C8b='EX',xtc='ElementMapperImpl',ytc='ElementMapperImpl$FreeNode',qcc='English',mqc='Enum',hcc='Etc/GMT',jcc='Etc/GMT+',icc='Etc/GMT-',R8b='Event type',nwc
